import React from 'react';

const Select = props => {
    return (
        <div className="form-group">
            <label>{props.title}</label>
            <select 
                className="form-control" 
                id={props.name} 
                name={props.name} 
                type={props.inputtype} 
                value={props.value}
            >
            {props.options.map(option => {
                return (
                    <option>
                        {option}
                    </option>
                );
            })}   
            </select>
        </div>
    )
}

export default Select;
